import React from "react";

const Navbar = () => {
    return (<div className='navbar'>
        <div className='navbar__items'>
            <Link to='/about'>О сайте</Link>
            <Link to='/posts'>Посты</Link>
        </div>
    </div>);
}
export default Navbar;
